import { bindActionCreators } from "redux";
import { connect } from "react-redux";
import { LandingPageView } from "./view";
import {updateUserName} from '../../actionCreators/userActionCreator'

const mapStateToProps = (state, props) => {
    return {};
};

const mapDispatchToProps = dispatch => {
    return bindActionCreators({updateUserName}, dispatch);
};

export default connect(mapStateToProps,mapDispatchToProps)(LandingPageView);
